function Breadcrumb({links}) {
    return (
        <div className="breadcrumb">
            {
                links.map(link => {
                    return (
                            link.activeLink ?
                            <a href={link.toPage}>{link.linkName}{link.separator}</a> :
                            link.linkName
                    )
                })
            }
        </div>
    )
}

export default Breadcrumb
